    rght          int unsigned not null,
    tree_id       int unsigned not null,
    level         int unsigned not null,
    dict_table_id int          not null,
    parent_id     int          null,
    `order`       int          not null,
    is_builtin    tinyint(1)   not null,
    constraint service_dictdata_dict_table_id_key_481bd261_uniq
